const axios = require('axios').default;

var allPlayers;

axios.get('https://www.balldontlie.io/api/v1/players/15')
  .then(function (response) {
    var player = response.data;
    console.log(player.first_name);
  })
  .catch(function (error) {
    console.log(error);
  })
  .then(function () {
  });
